  return (
    <html lang="en" dir="ltr">
    <head>
        <meta name="viewport" content="width=device-width, initial-scale=1"/>
        <link rel="stylesheet"/>
        <title>NBA Newsletter</title>
    </head>
    <body>
        <div>
            <div>
                <div class="sidebar">

                </div>
                <div class="main-section">

                </div>
            </div>
        </div>
    </body>
    </html>
  );
}

export default Home;
